function GoogleMaps(a){var e=a.getAttribute("data-googlemaps-lat"),o=a.getAttribute("data-googlemaps-lng"),g=new google.maps.LatLng(e,o),p={zoom:13,scrollwheel:!1,MapTypeId:google.maps.MapTypeId.ROADMAP,center:g};map=new google.maps.Map(a,p),marker=new google.maps.Marker({map:map,draggable:!1,animation:google.maps.Animation.DROP,position:g})}